import React from "react";
import { RoomBox } from "./style";
import UserComponent from "./UserComponent";

const RoomsList = () => {


    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        })
        return(
  <>
    <RoomBox>
      <UserComponent />
    </RoomBox>
  </>
        )
};
export default RoomsList;
